	(371, 1, 448, 'PERANCANGAN SISTEM INFORMASI PENGOLAHAN PELATIHAN PADA BALAI DIKLAT INDUSTRI (BDI) PADANG BERBASIS MOBILE APPLICATION MENGGUNAKAN API (APPLICATION PROGRAMMING INTERFACE)', 'Teknologi yang semakin  maju menjadikan sebuah perusahan atau organisasi atau intansi dalam mengembangkan aplikasi website ke aplikasi mobile. Aplikasi mobile ini sering digunakan dan mudah dibawa kemana saja serta tidak memakan space dalam menyimpan perangkat ini. Salah satu instansi yang ingin mengembangkan aplikasi website ke mobile adalah Balai Diklat Industri (BDI) Padang. Balai Diklat Industri (BDI) Padang berfokuskan kepada pelatihan di bidang border dan fesyen. Pelatihan akan mengambangkan kemampuan dari bidang yang diambil oleh seorang individu atau kelompok. Pelatihan yang dilaksanakan sangatlah singkat selama 18 hari. Untuk itu, karyawan harus mengelola pelatihan diklat agar tidak adanya jadwal yang sama. Banyaknya pelatihan – pelatihan yang dilakukan menjadikan karyawan harus mengelola data – data yang ada dari peserta, pengajar, dan asisten. Adanya permsalahan ini, Aplikasi ini bertujuan untuk memudahkan karyawan dan peserta dalam mengakses proses yang ada. Metode penelitian yang digunakan yaitu observasi, wawancara, kuesioner, dan studi literatur sebagai landasan teori, serta menggunakan metode waterfall. Aplikasi ini juga menggunakan API (Application Programming Interface) sebagai media perantara antara sistem satu dengan sistem lainnya. Hasil yang didapatkan dari penelitian adalah perancangan sistem informasi pengolahan pelatihan pada Balai Diklat Industri (BDI) Padang menggunakan API.\r\n\r\nKeyword: Teknologi, Pelatihan, Mobile, API', '2021-06-28', 15, NULL, NULL, NULL, '2021-06-28 09:10:24', '2021-12-03 03:48:16'),
	(372, 1, 446, 'PEMBANGUNAN SISTEM INFORMASI AKADEMIK SOP MONITORING DAN EVALUASI (MONEV) PERKULIAHAN FTI - UNAND DENGAN METODE REST API  BERBASIS WEB MENGUNAKAN FRAMEWORK CODEIGNITER', 'PERANCANGAN SISTEM INFORMASI AKADEMIK SOP MONITORING DAN EVALUASI (MONEV) PERKULIAHAN FTI - UNAND DENGAN METODE REST API  BERBASIS WEB MENGUNAKAN FRAMEWORK CODEIGNITER', '2021-06-30', 15, NULL, NULL, NULL, '2021-06-29 16:59:09', '2021-12-07 12:29:09'),
