	(377, 1, 463, 'PEMBANGUNAN SISTEM INFORMASI KEPEGAWAIAN BERBASIS WEB MENGGUNAKAN FRAMEWORK DJANGO PADA YAYASAN SHINE AL-FALAH DI KOTA PADANG', 'Sejak awal berdiri sampai pada saat penelitian ini dibuat, Yayasan Shine Al-Falah sudah memiliki sekitar 144 orang pegawai yang bekerja baik di bagian lembaga pendidikan maupun mengurus kegiatan yayasan di luar proses belajar. Namun, pegawai dengan jumlah yang banyak tersebut pendataannya masih dilakukan secara manual dan masih belum terorganisir serta terkomputerisasi dengan baik. Pembangunan sistem informasi kepegawaian yang berbasis web bertujuan untuk mengatasi permasalahan pencatatan dan pendataan pegawai pada Yayasan Shine Al-Falah di Kota Padang. Selain memudahkan yayasan dari segi pemakaian, sistem informasi berbasis web juga sangat mudah untuk diakses tanpa harus menggunakan perangkat atau sistem operasi komputer jenis tertentu. Tujuan dari penelitian ini adalah untuk menganalisis, merancang, membangun, serta menguji sistem informasi kepegawaian berbasis web pada Yayasan Shine Al-Falah di Kota Padang. Metode pengembangan sistem yang digunakan adalah waterfall. Tahapan metode waterfall yaitu menganalisis, merancang, membangun dan pengujian. Sistem informasi ini diimplementasikan dengan menggunakan bahasa pemrograman Python dan basis data yang digunakan adalah mySQL. Pengujian aplikasi dilakukan dengan metode black box testing, yaitu menguji setiap fungsional aplikasi apakah sudah berjalan sesuai dengan analisis dan perancangan yang diharapkan. Penelitian ini menghasilkan suatu sistem informasi kepegawaian berbasis web pada Yayasan Shine Al-Falah di Kota Padang yang akan memudahkan pengelolaan data pegawai pada yayasan dalam hal pencatatan, pengarsipan dan pelaporan.', '2022-11-08', 5, NULL, NULL, NULL, '2021-07-13 14:46:27', '2022-11-08 05:28:56'),
	(378, 1, 458, 'Pembangunan Sistem Informasi Pemesanan dan Pengelolaan Layanan Jasa Poligraf Berbasis Web pada PT Poligraf Indonesia', 'Pembangunan Sistem Informasi Pemesanan dan Pengelolaan Layanan Jasa Poligraf Berbasis Web pada PT Poligraf Indonesia', '2021-07-13', 30, NULL, NULL, NULL, '2021-07-13 14:57:44', '2022-10-19 07:35:19'),
	(379, 1, 440, NULL, NULL, NULL, 0, NULL, NULL, NULL, '2021-07-13 15:09:37', '2021-07-13 15:09:37'),
	(380, 4, 440, NULL, NULL, NULL, 0, NULL, NULL, NULL, '2021-07-13 15:13:45', '2021-07-13 15:13:45'),
	(382, 1, 476, NULL, NULL, NULL, 0, NULL, NULL, NULL, '2021-07-13 15:16:16', '2021-07-13 15:16:16'),
	(383, 1, 462, 'PEMBANGUNAN SISTEM INFORMASI SANTRI BERBASIS WEB MENGGUNAKAN FRAMEWORK DJANGO PADA YAYASAN SHINE AL-FALAH KOTA PADANG', 'Yayasan Shine Al-Falah merupakan tempat dimana anak yatim dan/atau piatu, anak keluarga kurang mampu, serta anak kedisabilitasan tinggal dan menempuh pendidikan setara SD, SMP, dan SMA. Panti asuhan sekaligus pondok pesantren ini telah menampung ribuan santri sejak awal berdirinya, dan sejak penelitian ini dibuat terdapat sekitar 708 santri yang telah terdaftar di Yayasan Shine Al-Falah. Pengurus Yayasan Shine Al-Falah mendata setiap santri per- tiga bulan sekali namun masih dilakukan secara sederhana dan belum terorganisir dengan baik. Cara tersebut dinilai kurang efektif dan efisien, karena akan terjadi kendala yaitu membutuhkan waktu yang lama untuk mendata setiap santri. Salah satu alternatif yang dapat digunakan untuk mengatasi permasalahan tersebut ialah dengan memanfaatkan sistem informasi untuk pendataan setiap santri melalui pengembangan Sistem Informasi Santri berbasis web. Metode pengembangan sistem yang digunakan adalah metode waterfall. Aplikasi ini diimplementasikan dengan menggunakan bahasa pemrograman Python dan basis data MySQL. Aplikasi ini dapat digunakan untuk melihat, mencari, mengetahui informasi, dan mengelola data mengenai santri-santri yang terdaftar pada Yayasan Shine Al-Falah di Kota Padang. Pada aplikasi ini juga dilengkapi dengan pengelolaan instrumen awal masuk Yayasan Shine Al-Falah dan assesment penyandang masalah kesejahteraan sosial santri pada yayasan. Pengujian dilakukan menggunakan metode black box untuk menguji setiap fungsional yang ada. Penelitian ini menghasilkan suatu sistem informasi santri berbasis web pada Yayasan Shine Al-Falah di Kota Padang.', '2022-11-08', 5, NULL, NULL, NULL, '2021-07-13 15:23:32', '2022-11-08 05:29:02'),
	(384, 6, 440, 'PEMBANGUNAN APLIKASI SISTEM PENDUKUNG KEPUTUSAN DENGAN MENGGUNAKAN HASIL ANALISIS METODE ANALYTIC HIERACHY PROCESS, SIMPLE ADDITIVE WEIGHT, DAN WEIGHTED PRODUCT DALAM MENENTUKAN PEMBELIAN MOBIL BARU DI AUTO 2000 PADANG', NULL, NULL, 0, NULL, NULL, NULL, '2021-07-13 15:27:52', '2021-07-13 15:27:52'),
	(385, 1, 464, NULL, NULL, NULL, 0, NULL, NULL, NULL, '2021-07-13 15:41:18', '2021-07-13 15:41:18'),
	(386, 4, 421, NULL, NULL, NULL, 0, NULL, NULL, NULL, '2021-07-13 16:07:06', '2021-07-13 16:07:06'),
	(387, 1, 488, 'RANCANG BANGUN SISTEM INFORMASI MANAJEMEN ASET BERBASIS WEB PADA YAYASAN SHINE AL FALAH DI KOTA PADANG', 'Yayasan Shine Al Falah merupakan salah satu yayasan di Kota Padang yang bergerak dengan fokus pada bidang pendidikan. Dalam kegiatannya yayasan mengelola beberapa lembaga dan unit kegiatan seperti panti asuhan, lembaga pendidikan (MIS, MTS, MAN), Ziswaf Al Falah, Koperasi Syari’ah Al Falah, dan Usaha Ekonomi Produktif (UEP) yayasan. Setelah dilakukan analisis didapati bahwa proses pengelolaan aset yang dilakukan di yayasan belum maksimal karena masih dikelola dengan cara konvensional mulai dari pendataan aset, penghapusan aset,dan pelabelan aset. Dengan banyaknya lembaga dan unit kegiatan yang dikelola yayasan tentu akan menyulitkan apabila pengolaan aset terus dilakukan dengan cara tersebut. Berdasarkan hal itu penulis memandang bahwa, perlu adanya sistim informasi yang dapat digunakan dalam pengelolaan aset sehingga pengelolaan aset dapat berjalan dengan optimal. Sistim Informasi yang dibangun berbasis web dengan menggunakan bahasa pemograman Python, Framework Django, dan basis data yang digunakan adalah MySql. Pembangunan aplikasi ini terdiri dari beberapa tahapan, yaitu pengumpulan data, pengembangan aplikasi dengan metode waterfall, dan pengujian sistem dengan metode black box. \r\n\r\nKata Kunci : Sistim Informasi Manajemen Aset , black box, web, Python, MySql', '2022-11-08', 5, NULL, NULL, NULL, '2021-07-13 17:57:37', '2022-11-08 05:29:11'),
	(388, 6, 455, 'Pembangunan Sistem Pendukung Keputusan Pemilihan Kepala Sekolah Berprestasi Menggunakan Metode Weighted Product di Dinas Pendidikan dan Kebudayaan Kabupaten Pesisir Selatan', NULL, NULL, 0, NULL, NULL, NULL, '2021-07-26 14:59:52', '2021-07-26 14:59:52'),
	(389, 1, 409, 'PERANCANGAN SISTEM INFORMASI PENILAIAN KAIZEN BERBASIS WEB (STUDI KASUS PT. SEMEN PADANG)', 'Bangunan tidak lepas dari kebutuhan hidup manusia sehari-hari dimana sentral-sentral kota seperti pelabuhan, dermaga, gedung pencakar langit dan sebagainya dibangun dengan teknologi yang terus berkembang dan tentu saja bahan bangunan.	Industri bangunan di zaman sekarang dituntut untuk membangun presisi dimana sebuah bangunan harus memiliki standar dan jumlah yang berdasarkan kebutuhan dari bidang ilmu itu sendiri(efektivitas dan efisiensi bahan bangunan). Pattern Recognition digunakan untuk mengidentifikasi lanskap bangunan yang diinput dan memisahkannya melalui komponen-komponen sehingga menghasilkan jumlah bahan bangunan yang presisi', '2021-08-05', 15, NULL, NULL, NULL, '2021-08-05 15:33:49', '2022-07-11 11:59:45'),
