	(399, 4, 435, 'KLASIFIKASI HURUF BRAILLE DENGAN MEMANFAATKAN IMAGE PROCESSING MENGGUNAKAN DEEP LEARNING METODE CONVOLUTIONAL NEURAL NETWORK', 'Penelitian ini bertujuan untuk melakukan klasifikasi huruf Braille menggunakan deep learning metode convolutional neural network. Aplikasi ini dibangun untuk memudahkan para pengajar maupun orang yang ingin mempelajari huruf Braille. Dengan adanya perkembangan di bidang image mining, klasifikasi huruf Braille bisa dilakukan dengan mudah. Metode Convolutional Neural Network adalah salah satu jenis neural network yang biasa digunakan pada data image. Input yang digunakan pada penelitian ini merupakan citra huruf Braille dengan unsur grayscale. Output dari data tersebut merupakan huruf abjad biasa. Data penelitian ini terdiri dari data training dan data testing sebanyak 2.722 buah. Fungsi aktivasi yang digunakan yaitu ReLU dan softmax. Hasil akurasi yang didapatkan pada proses training data dengan menggunakan MaxPooling dan epoch 100 untuk data training sebesar 96,64% dan pengujian yang dilakukan menggunakan sistem yang dibangun diperoleh nilai keakuratan pada seluruh data citra huruf Braille sebesar 88,07%.', NULL, 0, NULL, NULL, NULL, '2021-08-22 23:12:08', '2021-08-22 23:12:08'),
	(400, 4, 435, 'Klasifikasi Huruf Braille dengan Memanfaatkan Image Processing Menggunakan Deep Learning Metode Convolutional Neural Network', 'Klasifikasi Huruf Braille dengan Memanfaatkan Image Processing Menggunakan Deep Learning Metode Convolutional Neural Network', '2020-06-25', 30, NULL, NULL, NULL, '1970-01-01 00:09:06', '2021-12-03 04:01:44'),
	(401, 1, 491, 'Pembangunan Aplikasi Pelaporan Bencana Berbasis Mobile pada BPBD Sumatera Barat', 'Aplikasi ini digunakan oleh staff BPBD Sumbar untuk melaporkan bencana saat datang langsung ke TKP. Hal-hal yang dilaporkan seperti: tempat dan waktu kejadian, berapa jumlah korban yang meninggal/ luka-luka/ selamat, kerusakan akibat bencana, bantuan yang disalurkan, dan sebagainya. Namun dalam penerapannya saat ini BPBD Sumbar masih menggunakan Ms. Excel, maka dari itu dibuatlah aplikasi pelaporan bencana berbasis mobile sehingga memudahkan staff dalam membuat laporan di TKP. Selain itu, diharapkan aplikasi ini juga dapat mendeteksi lokasi penggunanya secara langsung.', '2021-09-09', 15, NULL, NULL, NULL, '2021-09-08 17:53:30', '2022-01-17 04:23:36'),
