	(412, 6, 538, 'Pembangunan Sistem Pendukung Keputusan Pemilihan Jurusan Dengan Menggunakan Penerapan Logika Fuzzy Tsukamoto (Studi Kasus : Man 2 Solok)', 'MAN 2 SOLOK merupakan salah satu MAN yang ada di Kabupaten solok, dimana pada saat sekarang ini di MAN 2 SOLOK belum ada websitenya dan sistem pemilihan jurusan masih dilakukan secara manual, oleh karena itu di rancang sebuah Sistem Pendukung keputusan untuk memudahkan dalam pemilihan jurusan bagi siswa di MAN 2 SOLOK', '2021-11-10', 20, NULL, NULL, NULL, '2021-11-10 09:48:23', '2022-09-23 09:20:02'),
	(413, 6, 519, 'Sistem Pendukung Keputusan Seleksi Penerimaan Asisten Laboratorium Berbasis web Menggunakan Logika Fuzzy (Studi Kasus : Laboratorium Buangan Padat Jurusan Teknik Lingkungan Universitas Andalas)', 'Kesulitan dalam menentukan pilihan jurusan kuliah sering dialami oleh siswa kelas 12, Akibatnya, banyak siswa yang memilih jurusan tidak berdasarkan minat, bakat dan prestasi belajarnya sehingga dengan adanya Sistem Teknik Pengambilan keputusan ini nantinya dapat membantu siswa menetukan jurusan apa yang sesuai dengan kemampuan serta minat bakatnya.', '2021-11-10', 20, NULL, NULL, NULL, '2021-11-10 10:17:34', '2022-09-23 09:20:19'),
