	(418, 6, 541, 'Pembangunan Sistem Pendukung Keputusan Pemilihan Produk Promo Menggunakan Metode Analytical Hierarchy Proceaa dan Simple Additive Weighting (Studi Kasus : XD House Café and Resto)', 'Pembangunan Sistem Pendukung Keputusan Pemilihan Produk Promo Menggunakan Metode Analytical Hierarchy Proceaa dan Simple Additive Weighting (Studi Kasus : XD House Café and Resto)', '2021-11-15', 35, NULL, NULL, NULL, '1970-01-01 00:09:06', '2022-09-06 16:09:59'),
	(419, 1, 470, 'PEMBANGUNAN APLIKASI SISTEM PENGELOLAAN PELAYANAN POSYANDU BERBASIS WEB PADA JORONG BASO DI KABUPATEN AGAM', 'Posyandu atau pos pelayanan terpadu merupakan sebuah layanan kesehatan yang diberikan oleh pemerintah untuk semua masyarakat di Indonesia terkhususnya untuk ibu dan anak usia 0-5 tahun. Pelayanan ini diberikan secara gratis dengan tujuan memberikan perlindungan dan konsultasi kesehatan. Layanan ini juga tersebar di semua daerah, salah satunya daerah jorong Baso yang ada di Kabupaten Agam. Namun pada posyandu Jorong Baso proses kegiatan masih dilakukan secara manual dan belum terkomputerisasi seperti pendaftaran ibu dan anak yang baru lahir, pencatatan rekam medis dan laporan kegiatan posyandu yang masih berupa kertas dan buku. Sehingga setiap proses kegiatan membutuhkan waktu dalam menyelesaikan pencatatan dan merekap ulang data. Hal tersebut menjadi permasalahan pada posyandu di Jorong Baso dikarenakan kurangnya efektifitas dan efisiensi dalam memberikan pelayanan kesehatan pada masyarakat. Selain itu, keamanan dari data-data yang bersifat pencatatan manual dirasa kurang aman dan dapat terjadi kekeliruan serta dapat mengakibatkan kehilangan data. Maka dari itu, dibutuhkan rancangan sistem aplikasi yang mampu mengatasi permasalahan yang terjadi pada posyandu di Jorong Baso dan mampu mengelola segala bentuk proses kegiatan posyandu. Sehingga mempermudah kader posyandu dalam melakukan pencatatan laporan kegiatan dan penyampaian informasi kepada peserta posyandu serta mempermudah dalam memantau kesehatan dan perkembangan ibu dan anak. Rancangan aplikasi ini dibuat berdasarkan analisa kebutuhan dari permasalahan yang ada dan dikembangkan kedalam sistem aplikasi berbasis web menggunakan bahasa pemograman PHP, framework Laravel dan database MySQL. Untuk metode pengembangan sistem yang digunakan dalam penelitian ini adalah metode waterfall. Selain itu, penelitian ini dilakukan dengan cara studi literatur sebagai landasan teori serta melakukan observasi, wawancara dan mengumpulkan dokumen-dokumen sebagai sumber data dalam membangun sistem serta akan dilakukan tahap pengujian sistem agar sesuai dengan kebutuhan yang dirancang. Hasil dari penelitian ini berupa sistem aplikasi posyandu berbasis web yang dapat menyelesaikan permasalahan yang ada pada pelayanan posyandu di Jorong Baso.', NULL, 0, NULL, NULL, NULL, '2021-12-20 09:39:48', '2021-12-20 09:39:48'),
