	(424, 1, 529, 'Sistem Informasi Pengelolaan Obat di Gudang Farmasi Dinas Kesehatan Kabupaten Limapuluh Kota Berbasis Web', 'Dinas Kesehatan Kab. Limapuluh Kota merupakan instansi pemerintah yang bertanggung jawab menyusun pedoman teknis bidang kesehatan di Kab. Limapuluh Kota. Penyelenggaraan pelayanan pemerintah dan pelayanan kesehatan masyarakat. Saran dan dukungan kesehatan di kecamatan dan nagari, serta melaksanakan tugas  penanggulangan penyakit dan bencana, sumber daya kesehatan, informasi kesehatan, pemberdayaan masyarakat, dan peningkatan pelayanan kesehatan. Masalah yang muncul di bagian gudang farmasi yaitu kondisi dimana suatu obat yang mahal dan tidak ada pengingat kapan kadaluarsanya sehingga mengakibatkan obat tadi terbuang dan tidak dapat digunakan. Oleh karena itu, perlu dirancang dan dikembangkan sistem informasi berbasis web untuk pengelolaan obat di gudang farmasi Dinas Kesehatan Kabupaten Limapuluh Kota.', NULL, 0, NULL, NULL, NULL, '2022-01-06 12:51:43', '2022-01-06 12:51:43'),
	(425, 1, 419, 'Pembangunan Sistem Informasi Penilaian dan Pengelolaan Mentoring Agama Islam Universitas Andalas', 'Mentoring Agama Islam (MAI) adalah suatu proses pembinaan akhlak yang harus dilalui setiap mahasiswa muslim yang mengambil mata kuliah Pendidikan Agama Islam (PAI). MAI dilakukan secara berdiskusi dalam kelompok antara mentor dan mentee. Kegiatan MAI ini akan mendapatkan penilaian dari mentor. Di Universitas Andalas, proses penilaiannya meliputi presensi dan ujian praktek mentoring. Dalam proses penilaian dan pengelolaan mentoring, masih dilakukan perhitungan dengan Microsoft Excel. Hal ini menyebabkan  pengumpulan rekapan penilaian dan pengelolaan berjalan lamban serta sulitnya mengorganisir penilaian sesuai fakultas dan dosen pengampu. Untuk mengatasi permasalahan tersebut, dalam penelitian ini dirancang dan dibangun Sistem Informasi Penilaian dan Pengelolaan Mentoring Agama Islam Universitas Andalas. Penelitian ini dilakukan dengan menggunakan metode pengumpulan data berupa wawancara, observasi, studi literatur, dan analisis dokumen. Aplikasi ini dikembangkan berbasis web dengan menggunakan metode waterfall menggunakan bahasa pemograman PHP dengan framework Laravel. Adapun hasil dari penelitian ini adalah sistem informasi yang ditawarkan sebagai solusi dalam pendistribusian penilaian dan pengelolaan data Mentoring Agama Islam Universitas Andalas.', NULL, 0, NULL, NULL, NULL, '2022-01-10 13:00:38', '2022-01-10 13:00:38'),
