	(431, 1, 501, 'PEMBANGUNAN SISTEM INFORMASI\r\nPENGELOLAAN KULIAH KERJA NYATA (KKN) PADA UPT KKN\r\nUNIVERSITAS ANDALAS', 'Belum adanya sistem informasi yang mengelola sistem Kuliah Kerja Nyata di \r\nUniversitas Andalas secara otomatis membuat pihak UPT KKN (Unit Pelaksanaan \r\nTeknis KKN) kesulitan mengelola teknis dan sistem KKN. Ditambah dengan \r\npenyebaran Covid-19 membuat kompleksitas pengelolaan KKN menjadi semakin \r\nrumit karena pola KKN Universitas Andalas beberapa tahun belakangan ini \r\nberbasis tempat tinggal/kampung mahasiswa dimana mahasiswa akan \r\nmelaksanakan KKN di daerahnya masing-masing. Berdasarkan permasalahan \r\ntersebut UPT KKN Universitas Andalas membutuhkan sistem informasi yang dapat \r\nmengelola sistem KKN secara keseluruhan. Saat ini pengelolaan KKN Universitas \r\nAndalas yang dikelola UPT KKN Unand terbilang masih manual dan belum \r\nterintegrasi mulai dari pendaftaran, pembagian kelompok, daerah, maupun DPL \r\nserta penyembaran informasi yang masih dilakukan dibanyak platform berbeda. \r\nSelain menyulitkan pihak UPT hal ini juga tentu menyulitkan mahasiswa dan DPL \r\nitu sendiri. Tujuan dari penelitian ini adalah untuk menganalisis, merancang, \r\nmembangun, serta menguji sistem informasi pengelolaan KKN Universitas \r\nAndalas. Sistem informasi ini dikembangkan dengan metode waterfall dan berjalan \r\npada platform website dengan menggunakan browser yang responsive di platform \r\nmobile. Penelitian ini akan menghasilkan sistem informasi pengelolaan KKN yang \r\ndiharapkan dapat memudahkan pihak UPT KKN dalam pengelolaan KKN serta \r\nmeningkatkan kinerja dalam menajalankan kewajiban Tri Dharma Perguruan \r\nTinggi pengabdian masyarakat.', NULL, 0, NULL, NULL, NULL, '2022-01-28 12:48:49', '2022-01-28 12:48:49'),
