	(443, 1, 500, 'Penerapan Sistem Pendukung Keputusan Dalam Menentukan Buah Mentimun Terbaik Pada Petani Timun Koto Tinggi dengan Menggunakan Perbandingan Metode SAW dan Topsis', 'Penerapan Sistem Pendukung Keputusan Dalam Menentukan Buah Mentimun Terbaik Pada Petani Timun Koto Tinggi dengan Menggunakan Perbandingan Metode SAW dan Topsis', '2022-03-25', 15, NULL, NULL, NULL, '1970-01-01 00:09:06', '2022-03-28 12:01:12'),
	(444, 4, 490, 'PEMBANGUNAN MODEL CLASSIFIER DATA MINING UNTUK KLASIFIKASI TINGKATAN HADITS BERDASARKAN SANAD MENGGUNAKAN METODE NAÏVE BAYES PADA PEMBELAJARAN HADITS', 'Sejauh ini tidak setiap muslim mengetahui dengan pasti tingkatan-tingkatan hadits, terlebih lagi banyak hadits palsu yang beredar di masyarakat sehingga menimbulkan berbagai permasalahan internal dan eksternal, bahkan terkadang sampai memuncak pada munculnya pemahaman-pemahaman yang tidak sesuai dengan syari’at Islam. Sehingga banyak muslim yang kesulitan dan menderita karena tidak mengetahui validitas hadits atau verifikasi derajat keshahihan hadits, dimana hadits merupakan sumber hukum kedua setelah Al-Quran sekaligus sumber hukum fundamental dalam kehidupan umat Islam. Meskipun banyak penjelasan yang beredar di internet tentang bagaimana cara melakukan verifikasi tingkatan hadits secara sederhana, namun pada akhirnya untuk menghindari was-was tetap harus bertanya kepada ahli hadits atau ulama yang mempunya ilmu tentangnya. Jadi belum ada sistem cerdas yang dilakukan dalam Bahasa Indonesia yang dapat membedakan hadits secara otomatis berdasarkan kategori yang diinginkan. Oleh karena itu dalam penelitian ini diusulkan model yang dapat mengenali dan mengklasifikasikan hadits secara otomatis ke dalam tingkatan shahih, hasan, dha’if dan maudhu, dengan memanfaatkan teknik machine learning. Klasifikasi ini dilakukan berdasarkan pada sanad hadits dengan menggunakan Metode Naïve Bayes.', NULL, 0, NULL, NULL, NULL, '2022-03-29 17:20:18', '2022-03-29 17:20:18'),
	(445, 1, 509, 'Pembangunan Sistem Pendukung Keputusan Pemilihan Devisi Bem Fakultas Teknologi Informasi Universitas Andalas Menggunakan Metode Topsis', 'Pembangunan Sistem Pendukung Keputusan Pemilihan Devisi Bem Fakultas Teknologi Informasi Universitas Andalas Menggunakan Metode Topsis', '2022-03-31', 15, NULL, NULL, NULL, '1970-01-01 00:09:06', '2022-04-19 11:51:15'),
