	(453, 1, 504, 'Pembangunan Sistem Informasi Pengusulan dan Peminjaman Aset Berbasis Mobile Pada Departemen Sistem Informasi Universitas Andalas', 'Departemen Sistem Informasi memiliki cukup banyak aset, sehingga dibutuhkan pengelolaan aset yang maksimal. Saat ini pengelolaan Aset di Departemen Sistem Informasi seperti proses pengusulan aset dan peminjaman aset masih dilakukan secara konvensional, dengan cara memberikan surat permintaan pengusulan ataupun peminjaman kepada penanggung jawab aset yang dituju. Namun, hal ini tentunya tidak efektif, karena ada kalanya penanggung jawab aset kewalahan dalam menanggapi proses permintaan yang terlalu banyak, sehingga mengalami kesulitan dalam mendapatkan informasi mengenai permintaan aset sebelum-sebelumnya, karena bisa saja surat hilang dan rusak. Untuk mengatasi masalah tersebut dibangunlah sebuah sistem informasi yang memudahkan admin dan pengguna dalam melakukan pengelolaan aset, pengusulan aset dan peminjaman aset secara efektif dan efisien. Sistem informasi ini dikembangkan dengan metode waterfall dan berjalan pada platform mobile dengan menggunakan sistem operasi android. Penelitian ini akan menghasilkan Pembangunan Sistem Informasi Pengusulan dan Peminjaman Aset Berbasis Mobile Pada Departemen Sistem Informasi Universitas Andalas. Diharapkan dengan dibangunnya sistem ini dapat memudahkan pengguna dalam melakukan pengusulan aset dan peminjaman aset baik inventaris atau fasilitas yang dimiliki oleh Departemen Sistem Informasi, dan memudahkan admin dalam mengelola aset yang dimiliki.', NULL, 0, NULL, NULL, NULL, '2022-09-09 15:57:49', '2022-09-09 15:57:49'),
	(454, 1, 422, 'Pemanfaatan Image Mining untuk Sistem Presensi Kuliah Mahasiswa dengan Pengenalan Wajah Menggunakan Deep Learning Metode Convolutional Neural Network', 'Pemanfaatan Image Mining untuk Sistem Presensi Kuliah Mahasiswa dengan Pengenalan Wajah Menggunakan Deep Learning Metode Convolutional Neural Network', '2022-07-01', 15, NULL, NULL, NULL, '1970-01-01 00:09:06', '2022-10-19 07:28:56'),
	(455, 4, 514, 'Aplikasi Analisis Sentimen Terhadap Pendapat Masyarakat Tentang Program Vaksinasi Covid-19 Pada Media Sosial Twitter Menggunakan Wodr2vec dan Machine Learning', 'Aplikasi Analisis Sentimen Terhadap Pendapat Masyarakat Tentang Program Vaksinasi Covid-19 Pada Media Sosial Twitter Menggunakan Wodr2vec dan Machine Learning', '2022-07-01', 15, NULL, NULL, NULL, '1970-01-01 00:09:06', '2022-11-15 03:59:54'),
	(456, 1, 445, 'Pemabngunan Sistem Informasi Pengelolaan Bantuan Dana Hibah Masjid Berbasis Web pada Biro Bina Mental dan Kesra Pemerintahan Provinsi Sumatera Barat', 'Sistem informasi pengelolaan bantuan dana hibah pada Biro Bina Mental dan Kersa Pemerintahan Provinsi Sumatera Barat masih belum terkomputerisasi. Proses bisnis yang berjalan saat ini menggunakan cara manual dan belum menggunakan sistem online yang terintegrasi. Dimana masyarakat yang mengajukan proposal bantuan dana hibah masjid datang langsung ke kantor biro untuk memberikan proposal yang diajukan. Selain itu proposal yang diajukan masyarakat belum terdata dengan baik, karena belum menggunakan basis data. Maka dari itu diperlukan pembangunan sistem informasi pemerintahan yang dikenal dengan nama e-Government untuk pengelolaan bantuan dana hibah pada biro bina mental dan kesra Pemerintahan Provinsi Sumatera Barat. Sistem informasi pengelolaan bantuan dana hibah masjid merupakan sistem yang melakukan pengelolaan pendataan masjid yang diusulkan dana hibah, penerimaan proposal yang diajukan oleh masyarakat, dan pelaporan dana hibah masjid yang diberikan setiap tahun, memberikan kemudahan  kepada biro bina mental dan kersa dalam melakukan pendataan dan evaluasi proposal hibah masjid dan lebih memudahkan  proses pengajuan baik oleh masyarakat maupun instansi. Pada sistem ini juga memberikan kemudahan bagi masyarakat diharapkan bisa mengawasi secara online sampai dimana perkembangan proposalnya telah diproses. Pengujian aplikasi dilakukan dengan black box testing dan simulasi. pada penelitian ini menggunakan metode waterfall.Bahasa pemrograman yang digunakan pada penelitian ini yaitu PHP dengan framework Laravel dan database MySQL. Hasil dari penelitian ini adalah sebuah sistem informasi web untuk pengelolaan bantuan dana hibah masjid yang dapat membantu dalam pendataan, peneriman, dan pelaporan dana hibah masjid pada biro bina mental dan kesra Pemerintahan Provinsi Sumatera Barat.', '2022-11-18', 5, NULL, NULL, NULL, '2022-10-14 17:57:31', '2022-11-18 01:24:13'),
	(457, 1, 532, 'Pembangunan Sistem Informasi Absensi Siswa Berbasis Mobile Menggunakan QR-Code Pada SMK Negeri 7 Padang', 'Pembangunan Sistem Informasi Absensi Siswa Berbasis Mobile Menggunakan QR-Code Pada SMK Negeri 7 Padang', '2022-10-04', 15, NULL, NULL, NULL, '1970-01-01 00:09:06', '2022-10-19 07:27:27'),
