	(459, 1, 537, 'Pembangunan Sistem Informasi Manajemen Rencana Pembelajaran Semester (RPS) Berbasis Outcome Based Education (OBE) dengan Frame work Laravel dan React JS', 'Pembangunan Sistem Informasi Manajemen Rencana Pembelajaran Semester (RPS) Berbasis Outcome Based Education (OBE) dengan Frame work Laravel dan React JS', '2022-10-04', 15, NULL, NULL, NULL, '1970-01-01 00:09:06', '2022-10-19 07:31:23'),
	(460, 1, 496, 'Pembangunan Sistem Pendukung Keputusan Pemilihan Pemenang Lomba Balita Sehat Pada Puskesmas Depok Jaya Menggunakan Metode Technique For Others Preference By Similarity (TOPSIS)', 'Pembangunan Sistem Pendukung Keputusan Pemilihan Pemenang Lomba Balita Sehat Pada Puskesmas Depok Jaya Menggunakan Metode Technique For Others Preference By Similarity (TOPSIS)', '2022-10-17', 15, NULL, NULL, NULL, '1970-01-01 00:09:06', '2022-10-19 07:32:33'),
	(461, 2, 517, 'Pembangunan Aplikasi Sistem Informasi Geografis Untuk Desa Wisata Kampung Minang Nagari Sumpu di Kabupaten Tanah Datar Berbasis Web dan Mobile', 'Pengembangan desa wisata merupakan salah satu program pemerintah yang memprioritaskan pengelolaan aktivitas pedesaan menjadi daya tarik untuk wisatawan. Salah satu desa yang ikut dalam pengembangan ini adalah Desa Wisata Kampung Minang Nagari Sumpu (Kampung Minang). Kampung Minang adalah salah satu tujuan wisata yang ada di Sumatera Barat karena budaya, aktivitas masyarakat, dan keindahan alamnya. Ketersediaan informasi terkait objek wisata di Kampung Minang masih kurang memadai sehingga wisatawan mengalami kesulitan mendapatkan informasi terkait objek wisata tersebut. Untuk mengatasi permasalahan tersebut, dilakukan pembangunan aplikasi Sistem Informasi Geografis (SIG) sebagai penunjang penyebaran informasi desa wisata dan dilengkapi dengan fitur-fitur spasial. Pembangunan aplikasi menggunakan metode riset dan pengembangan. Riset yang dilakukan berupa identifikasi keunikan desa dan kebutuhan pengguna. Metode waterfall digunakan untuk melakukan pengembangan aplikasi. Tujuan pembangunan ini adalah untuk memudahkan wisatawan mendapatkan informasi wisata di Kampung Minang, baik informasi spasial maupun informasi non-spasial. Pembangunan aplikasi ini menghasilkan aplikasi SIG untuk Kampung Minang di Kabupaten Tanah Datar (Sumatera Barat, Indonesia) Berbasis Web dan Mobile. Aplikasi ini dibangun menggunakan bahasa pemrograman PHP dengan framework CodeIgniter, bahasa pemrograman BASIC untuk mobile, basis data MySQL, dan peta Google Maps untuk menampilkan informasi spasial yang interaktif.', '2022-11-08', 15, NULL, NULL, NULL, '2022-11-07 04:46:41', '2022-11-08 07:04:29'),
	(462, 2, 531, 'PEMBANGUNAN APLIKASI SISTEM INFORMASI GEOGRAFIS UNTUK DESA WISATA SARIBU RUMAH GADANG NAGARI KOTO BARU DI KABUPATEN SOLOK SELATAN BERBASIS WEB DAN MOBILE', NULL, '2022-11-08', 5, NULL, NULL, NULL, '2022-11-08 06:46:59', '2022-11-08 07:28:58'),
	(463, 2, 523, 'PEMBANGUNAN APLIKASI SISTEM INFORMASI GEOGRAFIS UNTUK DESA WISATA TERINDAH DI DUNIA NAGARI PARIANGAN DI KABUPATEN TANAH DATAR BERBASIS WEB DAN MOBILE', NULL, '2022-11-15', 5, NULL, NULL, NULL, '2022-11-09 06:04:50', '2022-11-14 23:53:33'),
	(464, 1, 529, 'PEMBANGUNAN SISTEM INFORMASI MANAJEMEN STOK OBAT DI INSTALASI FARMASI KABUPATEN LIMA PULUH KOTA', 'Instalasi Farmasi Kabupaten Lima Puluh Kota (IFK) merupakan Unit Pelayanan Teknis (UPT) Dinas Kesehatan Lima Puluh Kota yang menyelenggarakan pelayanan kefarmasian ke 22 puskesmas di Kabupaten Lima Puluh Kota. Salah satu kegiatan pelayanan kefarmasian yang dilakukan IFK ialah manajemen stok obat. Manajemen stok obat yang dilakukan IFK diantaranya yaitu melakukan penerimaan obat dari Pemasok Besar Farmasi (PBF), pengelolaan obat dan pendistribusian obat serta melayani pelaporan pemakaian obat dari 22 puskesmas di Kabupaten Lima Puluh Kota. Saat ini IFK masih menggunakan sistem manual dalam menjalankan manajemen stok obat. Selain itu untuk mengetahui jumlah stok obat dan kadaluwarsa masih dilakukan pengecekan manual, sehingga sering didapati obat yang telah kadaluwarsa tetapi masih tersimpan didalam gudang. Untuk mengatasi masalah tersebut dibutuhkan sistem informasi yang mengintegrasikan serta mengkomputerisasi kegiatan manajemen stok obat. Maka dari itu penulis mengangkat masalah ini untuk meningkatkan pelayanan kefarmasian terutama dalam manajemen stok obat. Penelitian ini menggunakan metode waterfall sebagai metode pengembangannya. Adapun tahapan metode berupa analisis, perancangan, implementasi dan pengujian. Dari penelitian ini dihasilkan sebuah aplikasi sistem informasi manajemen stok obat pada instalasi farmasi menggunakan Framework Laravel dengan template argon dengan bahasa pemrograman PHP sebagai alat untuk pembangunan sistem ini. Dibangunnya aplikasi ini bertujuan mempermudah IFK dalam melakukan manajemen stok obat, serta efisiensi penggunaan obat dalam hal stok obat dan kadaluwarsa obat.', '2022-11-16', 5, NULL, NULL, NULL, '2022-11-11 02:48:51', '2022-11-17 03:02:49'),
	(465, 2, 535, 'PEMBANGUNAN APLIKASI SISTEM INFORMASI GEOGRAFIS\r\n UNTUK DESA WISATA KUBU GADANG DI KOTA PADANG PANJANG \r\nBERBASIS WEB DAN MOBILE', NULL, '2022-11-15', 5, NULL, NULL, NULL, '2022-11-11 05:58:08', '2022-11-14 23:53:40'),
	(466, 1, 536, 'Penerapan Enterprise Resource Planning pada Perusahaan Event Organizer untuk Sistem Pembelian, Pengelolaan Customer, dan Penggajian Pegawai Menggunakan Odoo', 'PT. ATIRO LUCKY SUBETAMA merupakan perusahaan jasa yang bergerak dibidang Event Organizer (EO) dan periklanan. Proses bisnis utama yang terjadi di perusahaan ini adalah proses pembelian sponsor, pengelolaan data customer, dan penggajian pegawai. Proses bisnis yang sedang berjalan  di perusahaan ini masih menggunakan sistem manual yang mana pegawai menyimpan data transaksi menggunakan Microsoft office dan menggunakan paper based untuk mencatat data penggajian pegawai. Sistem tersebut dapat mengakibatkan terjadinya kesalahan pencatatan data penggajian pembelian sponsor, lambatnya pertukaran informasi, kesalahan proses perhitungan gaji pegawai, dan membutuhkan biaya lebih untuk pencatatan menggunakan paper based. Oleh karena itu, diperlukan manajemen proses bisnis untuk mengoptimalkan proses bisnis pada perusahaan. Pada siklus manajemen proses bisnis terdapat beberapa tahapan yang diawali dengan identifikasi proses bisnis yang berjalan di perusahaan. Setelah itu proses bisnis akan dilakukan analisis untuk mengetahui masalah dan kelemahan yang terdapat pada proses bisnis tersebut. Setelah itu proses bisnis akan di rancang ulang untuk diusulkan kepada perusahaan. Proses bisnis dirancang menggunakan Business Process Modelling Notation (BPMN). Setelah  itu dilakukan implementasi proses bisnis yang sudah diusulkan dengan menggunakan Enterprise Resource Planning (ERP) Odoo sehingga dapat membantu perusahaan dalam melaksanakan proses bisnis menjadi efektif dan efisien. Pada penerapan ERP dilakukan kofigurasi dan kustomisasi aplikasi ERP sesuai dengan proses bisnis yang sudah diusulkan. Setelah itu dilakukan pengujian aplikasi ERP pada perusahaan. Hasil dari penelitian ini, yaitu penerapan aplikasi Odoo dapat membantu perusahaan dalam mengatasi masalah yang terjadi dan membantu menjalankan proses bisnis perusahaan dengan efektif dan efisien.', '2022-11-18', 5, NULL, NULL, NULL, '2022-11-17 12:10:59', '2022-11-18 01:24:22');
