	(188, 364, 475, '2021-03-22', 'Menampilkan progress aplikasi kepada pembimbing. Pembimbing memberikan saran berupa menambahkan 3 hak akses pada aplikasi, yakni: Admin, Juri, dan Superadmin. Superadmin ditujukan untuk Kepala Dinas Pendidikan Provinsi Sumatera Barat. Selain itu, NIP Guru, Kode Sekolah, nilai-nilai yang dimasukkan ke aplikasi tidak boleh sama dan keluar alert berwarna merah. Jika sama data tidak bisa tersimpan.', NULL, '188_6107fb4d57f68.docx', NULL, NULL, NULL, NULL, 0, '2021-08-02 14:03:57', '2021-08-02 14:03:57'),
	(189, 364, 475, '2021-05-04', 'Menampilkan progress aplikasi yang telah dibangun. Pembimbing memberikan saran menambahkan background pada halaman login. Selain itu, warna navbar beserta menu harus disesuaikan dengan warna lambang Dinas Pendidikan Provinsi Sumatera Barat. Selain itu, menambahkan menu home beserta judul.', NULL, '189_6107fb71c7229.docx', NULL, NULL, NULL, NULL, 0, '2021-08-02 14:04:33', '2021-08-02 14:04:33'),
	(190, 364, 475, '2021-05-21', 'Menampilkan aplikasi yang dibangun yang telah ditambahkan berupa menambahkan 4 diagram pada dashboard, menambahkan widget beserta warna link apabila belum di klik berwarna abu-abu, yang sedang diakses warnanya biru, dan telah di klik berwarna merah pada setiap halaman menu dan sub menu, menambahkan kalimat penjelasan minimial 3 kalimat pada setiap halaman.', NULL, '190_6107fb9c3d94e.docx', NULL, NULL, NULL, NULL, 0, '2021-08-02 14:05:16', '2021-08-02 14:05:16'),
	(191, 364, 475, '2021-07-18', 'Catatan revisi seminar hasil dari penguji, antara lain:\r\na.	Pada Abstrak, sebaiknya perbaiki betul kalimatnya, seperti:\r\nb.	Bukan data sampel lebih cocok objek riset kalimatnya\r\nc.	Jelaskan masalah apa yang muncul\r\nd.	Pada Bab 1, perlu diperbaiki, seperti:\r\ne.	Jelaskan manualnya seperti apa\r\nf.	Tambahkan kalimat penekanan kenapa dipilih dua metode ini yang dibandingkan\r\ng.	Tambahkan penunjuk halaman yang terdapat referensi jurnal terdahulu\r\nh.	Jelaskan alasan data tahun 2019 data yang digunakan untuk penelitian tugas akhir.\r\ni.	Pada Bab 2, perlu ditambah, seperti:\r\nj.	Referensi sumber pengertian sistem\r\nk.	Referensi sumber pengertian pendukung keputusan\r\nl.	Perlu diperbaiki Flowchart Metode SAW dan WP\r\nm.	Perlu ditambah referensi penelitian pada penyelesaian masalah metode SAW dan metode WP\r\nn.	Tambahkan referensi jurnal guru berprestasi terdahulu untuk dicantumkan pada sub bab 2.7 \r\no.	Keterangan rumus SAW\r\np.	Keterangan rumus WP\r\nq.	Pada Bab 3, sebaiknya dihapus jadwal penelitian\r\nr.	Pada bab 4, sebaiknya perlu ditambah, antara lain :\r\ns.	Pembobotan nilai diperoleh darimana\r\nt.	Penjeleasan tentang portofolio masih kurang\r\nu.	Penjelasan wawancara masih sangat minim, sebaiknya perlu ditambah lagi kalimatnya\r\nv.	Jelaskan pada sub bab tersebut mengapa data alternatifnya hanya ini yang dijadikan perhitungan.\r\nw.	Perlu tambahan dasarnya metode SAW\r\nx.	Perlu tambahan penjelasan dampaknya terhadap sekolah tersebut\r\ny.	Pada Bab 5, terdapat perbedaan nilai preferensi pada aplikasi dan perhitungan manual manakah yang benar 0,92188 atau 0,92168?', NULL, '191_6107fbddaf7a7.docx', NULL, NULL, NULL, NULL, 0, '2021-08-02 14:06:21', '2021-08-02 14:06:21'),
	(192, 364, 475, '2021-08-02', 'Catatan revisi seminar hasil dari penguji, antara lain:\r\na.	Tidak perlu diganti judulnnya. Karena dalam semhas kemarin sudah betul\r\nb.	Sebaiknya dalam abstrak dihindari kata “Pada Penelitian TA ini…“ Kalau di Latar Belakang tidak apa.\r\nc.	Tambahkan dokumen legal terhadap pemilihan guru berprestasi ini', NULL, '192_6107fc199ddf2.docx', NULL, NULL, NULL, NULL, 0, '2021-08-02 14:07:21', '2021-08-02 14:07:21'),
